INSERT INTO `news` (`ID`, `Title`, `Story`, `Date1`, `img`) VALUES
(4, 'ประกาศ...วันหยุดให้บริการ : เนื่องในวันอาสาฬหบูชาและวันเข้าพรรษา (๑๖-๑๗ ก.ค. ๖๒)', 'เนื่องในวันอาสาฬหบูชาและวันเข้าพรรษา', '2019-07-11', 'img_5d2da59f34ccb.jpg'),
(5, 'สวส.มทร.ล้านนา แนะนำบริการ : ยืมต่อด้วยตนเอง (Online Renewal Sevice)', 'สวส.มทร.ล้านนา แนะนำบริการ : ยืมต่อด้วยตนเอง (Online Renewal Sevice) \r\nhttp://autolib.rmutl.ac.th', '2019-07-08', 'img_5d2da5da970bd.jpg'),
(6, 'สวส.มทร.ล้านนา แนะนำบริการ : เว็บไซต์เพื่อการสืบค้นข้อมูล (ห้องสมุด มทร.ล้านนา)', 'สวส.มทร.ล้านนา แนะนำบริการ : เว็บไซต์เพื่อการสืบค้นข้อมูล (ห้องสมุด มทร.ล้านนา) https://library.rmutl.ac.th/', '2019-06-28', 'img_5d2dac7a8e21e.jpg'),
(7, 'โปรโมชั่น...ดีๆ 3 ต่อ !! : ช่วงปิดเทอม ยืมหนังสือ ยืมเยอะ ยืมนาน ต่ออายุการใช้งานด้วยตนเอง', 'โปรโมชั่น...ดีๆ 3 ต่อ !! : ช่วงปิดเทอม ยืมหนังสือ ยืมเยอะ ยืมนาน ต่ออายุการใช้งานด้วยตนเอง', '2019-06-20', 'img_5d2dacd68a2b4.jpg'),
(8, 'ประกาศ สวส.มทร.ล้านนา เชียงใหม่ : เรื่อง...เวลา เปิด - ปิด ให้บริการในช่วงสัปดาห์ก่อนสอบและช่วงสอบ', 'ประกาศ สวส.มทร.ล้านนา เชียงใหม่ : เรื่อง...เวลา เปิด - ปิด ให้บริการในช่วงสัปดาห์ก่อนสอบและช่วงสอบ (11-22 มี.ค.62)', '2019-06-11', 'img_5d2eeb7d33a64.jpg'),
(9, 'ขอเชิญชวน บุคลากรและนักศึกษา มทร.ล้านนา ร่วมเสนอรายชื่อหนังสือและวารสารวิชาการ', 'ขอเชิญชวน บุคลากรและนักศึกษา มทร.ล้านนา ร่วมเสนอรายชื่อหนังสือและวารสารวิชาการ', '2019-02-12', 'img_5d2eebde6cdf7.jpg'),
(10, 'ขอเชิญชวน...อาจารย์ บุคลากร นักศึกษา มทร.ล้านนา เสนอหนังสือและวารสารวิชาการเข้าห้องสมุด งปม. ๖๒', 'ขอเชิญชวน...อาจารย์ บุคลากร นักศึกษา มทร.ล้านนา เสนอหนังสือและวารสารวิชาการเข้าห้องสมุด งปม. ๖๒', '2018-11-16', 'img_5d3042651f615.jpg'),
(13, 'แจ้งกำหนดการปิดปรับปรุงระบบอินเทอร์เน็ตไร้สาย ', 'ประกาศ สวส.มทร.ล้านนา : แจ้งกำหนดการปิดปรับปรุงระบบอินเทอร์เน็ตไร้สาย (14 ต.ค.63 เวลา 18.00 น. - 24.00 น.)', '2020-10-09', 'img_5f8d2acbb3a92.jpg');
